VINCULOS.OUTRAS-INFORMACOES:
Tarefas executadas:
- preparação e lançamento de cultura de células de líqüido amniótico, vilosidades coriônicas, linfócitos, pele e aborto;
- processo completo de cultura de células (repique e troca de meio);
- processo bioquímico (hipotonia e lavagem de células, pingagem de lâminas e preparação de reagentes);
- congelamento e descongelamento de células;
- análise cromossômica em bandas G e Q;
- preparo de inoculações terapêuticas de células de pele e
- bateria de exames bioquímicos para constatação de erros inatos do metabolismo.

- coordenadora geral das ações da equipe de controle de endemias;
- controle de pragas e vetores (dengue e animais peçonhentos);
- projeto educativo junto às escolas públicas e particulares;
- identificação de larvas de insetos de interesse médico;
- participação em comissões municipais;
- responsável por processos administrativos (criação e comércio de iscas-vivas e
- responsável pela notificação de residências e terrenos em condições irregulares, que propiciem a proliferação do mosquito transmissor da dengue.
